import React from 'react';
import { View, ScrollView, Text, Dimensions, TouchableOpacity } from 'react-native';

function Profile(props) {
    const window = Dimensions.get('window')

    return (
        <ScrollView style={{
            height: '100%',
            width: '100%',
            backgroundColor: 'red',
            flexDirection: 'column',
            overflow: 'visible',
            

        }}>
            <View style={{
                width: window.width / 5,
                height: window.width / 5,
                borderRadius: window.width / 10,
                backgroundColor: 'white',
                position:'absolute',
                top:120,
                left:window.width/2,
                right:window.width/2,
                zIndex: 60,
                bottom: 6,
                
                alignItems: 'center',
                shadowOffset: {
                    height: 1,
                    width: 1,
                },
                shadowColor: 'black',
                shadowOpacity: 1,
                elevation: .5,
                shadowRadius: '50%',
                overflow: 'visible',
                backgroundColor:'black',

            }}>

            </View>

            <View style={{
                height: 400,
                backgroundColor: 'white',
                
                margin: 20,
                borderRadius:20,
                marginTop:170,
                
                

            }}>
            <Text style={{
                marginTop:60,
                textAlign:'center',
                
                fontWeight:'bold',

            }}>
                Eng.Md.Sazzad Hossain
            </Text>
            <Text style={{
                textAlign:'center',
            }}>
            sazzad15-2521@diu.edu.bd
            </Text>
            <View style={{
                height:5,
                backgroundColor:'red',
            }}>

            </View>

            </View>


        </ScrollView>
    );
}

export default Profile;
